drop table if exists friend;
create table friend(friend_index Int PRIMARY KEY auto_increment,followed_id varchar (30),follower_id varchar (30));
drop table if exists temp_friend;
create table temp_friend(friend_index Int PRIMARY KEY auto_increment,followed_id varchar (30),follower_id varchar (30));
delete from temp_friend where follower_id is NULL;
delete from temp_friend where follower_id not in (select user_id from user);
alter table friend add constraint followed_ref_userid FOREIGN  KEY (followed_id) references  user(user_id);
alter table friend add constraint follower_ref_userid FOREIGN  KEY (follower_id) references  user(user_id);
